function HtmlCss() {
  const style = {
    backgroundColor: "red",
    border: "1px solid black",
    height: "8vh",
  };
  return (
    <div>
      <div style={style}></div>
      <div style={style}></div>
    </div>
  );
}

export default HtmlCss;
